import { useState } from 'react';

const Example = () => {
  const [val, setVal] = useState('');
  const onChange = e => {
    setVal(e.target.value);
  };
  return (
    <>
      <label id='apple'>
        <input id='apple' type='radio' value='apple' onChange={onChange} />
        Apple
      </label>
      <label htmlFor='banana'>
        <input id='banana' type='radio' onChange={onChange} />
        Banana
      </label>
      <label htmlFor='cherry'>
        <input id='cherry' type='radio' value='cherry' onChange={onChange} />
        Cherry
      </label>
      <h3>私は{}が食べたい</h3>
    </>
  );
};

export default Example;
